import React, {useState} from 'react';

function App() {
 const [count, setCount] = useState(0)
  return (
    <div className="App">
      <div>{count}</div>
     <button onClick={() => ++setCount}>Incriment</button>
     <button onClick={() => setCount -= 1}>Decriment</button>
    </div>
  );
}

export default App;
